A scalar type represents a single value. Pint has three primary scalar types: integers, Booleans, and 256-bit hashes. Integer Type An integer is a number without a fractional component. Pint has a single integer type called int which, when targeting the EssentialVM, represents a 64-bit signed integer . An int, therefore, can store numbers from −(2n−1) to 2n−1−1 inclusive, where n is the number of bits that represent the integer (64 in the case of EssentialVM). You can write integer literals in any of the forms shown in the table below. Note that number literals can use _ as a visual separator to make the number easier to read, such as 1_000, which will have the same value as if you had specified 1000. Number literals Examples Decimal 12_333 Hex 0x123f Binary 0b1111_1101 Numeric Operations Pint supports the basic mathematical operations you’d expect for integers: addition, subtraction, multiplication, division, and remainder. Integer division truncates toward zero to the nearest integer. The following code shows how you’d use each numeric operation in a var statement: // addition
state sum = 1 + 2 + 3; // subtraction
state difference = 15 - 1; // multiplication
state product = 42 * 42; // division
state quotient = 3 / 2;
state truncated = -5 / 3; // Results is -1 // remainder
state remainder = 34 % 3; Note that binary operators in Pint are strict with regards to what types they allow, that is, only identical types can be used in a binary operator. For example, adding an int and a bool is not a valid operation and will result in a compile error. The Boolean Type As in most other programming languages, a Boolean type in Pint has two possible values: true and false. The Boolean type in Pint is specified using bool. For example: state t = true;
state f: bool = false; The b256 Type The b256 is a special type that represents a 256-bit hash. It is often used to represent addresses or storage keys and cannot be used as a numerical integers. That is, two b256 values cannot added for example. A b256 literals can be represented using a Hexadecimal or a Binary literal as follows: state addr1 = 0x3333333333333333333333333333333333333333333333333333333333333333;
