if statements are the last class of conditionals we will look at. Unlike select and cond expressions, if statements are not expressions, that is, they do not hold any values. Instead, they allow predicating blocks of code based on some condition. A block of code in the context of an if statement is a collection of constraints and other if statements. For example: if number < 5 { constraint x == y;
} else { constraint x != y;
} All if statements start with the keyword if, followed by a condition. In this case, the condition checks whether or not the decision variable number has a value less than 5. The code block that should be "active" if the condition is true is placed immediate after the condition inside curly brackets. Optionally, the keyword else is then added followed by the code block that should be active if the condition is false (also between curly brackets). In the example above, the if statement can be read as follows: "if number is less than 5, then x must be equal to y. Otherwise, x must not be equal to y". Similarly to select expressions, the condition of an if statement must be a bool. Otherwise we will get a compile error. if statements can be nested and can contain an arbitrary number of constraints: if number < 5 { constraint x == y; if z > 0 { constraint x > number; constraint y > number; }
} else { constraint x != y; if z > 0 { constraint x > number; constraint y > number; } else { constraint x < number; constraint y < number; }
}

