Consider the following example which takes an unknown US coin and determines which coin it is and returns its value in cents: union Coin = Penny | Nickel | Dime | Quarter; predicate CoinConversion1(coin: Coin) { state coin_in_cents = match coin { Coin::Penny => 1, Coin::Nickel => 5, Coin::Dime => 10, Coin::Quarter => 25, };
} Let’s break down the match expression above. First we list the match keyword followed by an expression, which in this case is the value coin. This seems very similar to a conditional expression used with cond, but there’s a big difference: with cond, the condition needs to evaluate to a Boolean value, but here it has to be a union variant of Coin because this is the type of the value coin. Next are the match arms. An arm has two parts: a pattern and some code. The first arm here has a pattern that is the value Coin::Penny and then the => operator that separates the pattern and the code to run. The code in this case is just the value 1. Each arm is separated from the next with a comma. In this particular example, the code associated with each arm is an expression, and the resultant value of the expression in the matching arm is the value that gets returned for the entire match expression. It is also possible to include constraints in the match arm code, but you must use curly brackets. For example, the following code requires the Boolean variable is_lucky_penny to be true if the value coin is a Coin::Penny. predicate CoinConversion2(coin: Coin, is_lucky_penny: bool) { state coin_in_cents = match coin { Coin::Penny => { constraint is_lucky_penny; 1 }, Coin::Nickel => 5, Coin::Dime => 10, Coin::Quarter => 25, };
} Patterns that Bind to Values Another useful feature of match arms is that they can bind to the value that match the pattern. This is how we can extract values out of union variants. As an example, let's change our union variants to hold data inside them. Namely, we want each variant to hold an int that represents the number of coins available: union Coins = Penny(int) | Nickel(int) | Dime(int) | Quarter(int); Now, given a value coins of type Coins, we can compute the total number of cents that coins is equivalent to as follows: predicate CoinConversion3(coins: Coins) { state coins_in_cents = match coins { Coins::Penny(n) => n, Coins::Nickel(n) => n * 5, Coins::Dime(n) => n * 10, Coins::Quarter(n) => n * 25, };
} In the match expression above, we add a variable called n for each of the patterns. In each pattern, n will bind to the value that the union variant holds. For example, if coins is equal to Coin::Nickel(42), then we expect coins_in_cents to be equal to 42 * 5 == 210. Note that match expressions can be nested. Here's an example that has nested unions and nested match expressions to compute a prize given a coin and the face it landed on in a head-or-tails game. union Face = Head | Tail;
union CoinFace = Penny(Face) | Nickel(Face) | Dime (Face) | Quarter(Face); predicate CoinGame1(coin: CoinFace) { state prize = match coin { CoinFace::Penny(f) => match f { Face::Head => 100, Face::Tail => 200, }, CoinFace::Nickel(f) => 5 * match f { Face::Head => 10, Face::Tail => 20, }, CoinFace::Dime(f) => 10 * match f { Face::Head => 5, Face::Tail => 10, }, CoinFace::Quarter(f) => 25 * match f { Face::Head => 1, Face::Tail => 2, }, };
}

