Simple macros take a fixed number of parameters, each starting with $. Consider the following simple macro: macro @in_range($v, $num) { constraint $v >= $num; constraint $v < ($num * $num);
} Macro definitions always start with the keyword macro followed by the name of the macro, which must start with @. Then, a list of named parameters is provided in between parentheses. The body of the macro is provided in between curly braces and can contain any code that uses the macro parameters. The macro above is named @in_range and takes 2 parameters named $v and $num. In the body of this macro, these parameters are used as expressions but this is not always necessarily the case! When this macro is used, two constraints are always produced. Let's use this macro as follows: var x: int;
@in_range(x; 10); To call the macro, we write its name followed by a list of arguments, separated by a semicolon (;), in between parentheses. The number of arguments must match the number of parameters that the macro expects. Note : yes, the arguments are separated by a semicolon (;) and not a comma (,). After the macro gets expanded, the compiler will produce code that is equivalent to the following: var x: int;
constraint x >= 10;
constraint x < (10 * 10); It should hopefully be quite clear to you how this substitution happened. The compiler simply rewrote the body of the macro by replacing $v with x and $num with 10. The resulting code is then pasted exactly where the macro was called. Arbitrary Tokens as Macro Arguments The arguments to a macro call may be collections of tokens which do not necessarily parse to a proper expression, as in the previous example. For example, an operator like + or a type name such as int are valid!. If the token is an identifier, then it may be used as a name, such as the name of a decision variable or a new type. Here's an example: macro @do_decls($a, $b, $ty, $op) { var $a: $ty; var $b: $ty; constraint $b $op $a;
} The author of this macro likely expects: $a and $b to be identifiers. $ty to be a type. op to be a binary operator such as +, -, etc. In fact, if the rules above are not respected when calling the macro, the program will likely fail to parse correctly resulting in a failed compilation. If we call the macro above with: @do_decls(x1; x2; int; >); the compiler will expand the macro call to: var x1: int;
var x2: int;
constraint x2 > x1; Hopefully this gives you an idea of how powerful macros can be. Macro Expressions So far, we've only looked at example macros where the body is a list of declarations (such as var declarations or constraints). Macros are even more versatile than that! Macros can, in fact, produce an expression. This would be akin to functions that return values in other programming languages. The expression that you want produced by the macro must always be the last statement in the macro body. For example: macro @quotion($a, $b) { constraint $b > 0; // Declaration. $a / $b // Final expression.
} Because this macro produces an expression, a call to it can be used as an expression as well. For example: var e: int;
var f: int;
var q: int = @quotion(e; f); As a result, the compiler will expand the macro call to: var e: int;
var f: int;
constraint f > 0;
var q: int = e / f; Note that the expression is always inserted at the exact location where the macro was called, but any declaration items in the macro body are inserted before the call. Declaring Variables in Macro Bodies Earlier, we looked at an example macro that uses some of its parameters as identifiers to declare some decision variables. When that macro is called multiple times with different arguments, the resulting var declarations will not cause any name conflicts. Now, what happens if, instead, we were to directly use an identifier in a macro body when declaring new variables? Here's an example: macro @is_even($a) { var half: int; constraint $a == half * 2;
} In a naive macro system, if @is_even was called more than once within the same module, then after expansion there would be multiple half variable declarations, resulting a name clash error. To avoid this problem Pint's macro expansion aims to be hygienic and places newly declared symbols into a unique anonymous namespace. Note that this is only done for symbols which are not macro parameters. To illustrate this, consider the following: macro @var_decls($a) { var foo: int; // Hygienic anonymous binding for `foo`. var $a: bool; // Lexical binding for `$a`.
} If we call the macro above using @let_decls(foo) there would not be an error as the expansion would be equivalent to: var anon_0::foo: int;
var foo: int; And even when called multiple times with different arguments there would be no error: @var_decls(foo);
@var_decls(bar); Becomes equivalent to: var anon_0::foo: int;
var foo: int;
var anon_1::foo: int;
var bar: int; Of course, if @let_decls was called with the argument foo multiple times there would be an error!

