The second type of macros we will look at is "Variadic Macros". Variadic macros allow a special type of recursion via variadic parameters . Such special parameters allow macros to call themselves, essentially entering an expansion loop . Think of this as recursive code generation . The term "variadic" means that the macro accepts a variable number of parameters. In the parameter list of the macro definition this is indicated using a special parameter whose name starts with an &. Recursion may be performed via one or more recursing macros and at least one non-recursing, or terminating macros. The recursing macros call other versions of itself but with a different number of - usually fewer - arguments. The terminating macros do not call another version of itself. This is best explained with an example, so let's consider the following macro which implements a sum operation over an arbitrary number of named variables: // Recursive Macro
macro @sum($x, $y, &rest) { // Called only when `&rest` is not empty. // We recurse by adding `$x` and `$y` and using `&rest` as the second argument. @sum($x + $y; &rest)
} // Terminating Macro
macro @sum($x, $y) { // Called only when the number of arguments is exactly 2. $x + $y
} We have two versions of the @sum macro. Despite the apparent name clash, this is actually okay because the two macros accept a different number of parameters. The first version of @sum accepts $x, $y, and &rest while the second version accepts only $x and $y. The parameter &rest is special and is referred to as a "parameter pack". The parameter pack is never empty, therefore in order to call the first version of @sum, we must pass 3 or more arguments. Note : The parameter pack is not addressable in any way. It may only be used as an argument to another macro call. Now let's walk through how the compiler would expand a call to @sum. You will notice that the compiler will always try to match the number of arguments provided to the number of parameters in each macro, and the best match will be selected. Calling @sum(a; b) will expand directly using the terminating macro to the expression a + b. Calling @sum(a; b; c; d) will expand as follows: @sum(a; b; c; d) calls the recursive macro as @sum(a; b; [c, d]) where [c, d] is &rest. @sum(a; b; [c, d]) expands to @sum(a + b; c; d). @sum(a + b; c; d) calls the recursive macro again, as @sum(a + b; c; [d]). @sum(a + b; c; [d]) expands to @sum(a + b + c; d). @sum(a + b + c; d) calls the terminating macro. @sum(a + b + c; d) expands to a + b + c + d, which is the final expanded form of the macro call. Note that, since the &rest parameter pack is passed in its expanded form, the above @sum macros could instead be rewritten as follows, to the same effect: // Recursive Macro
macro @sum_v2($x, &rest) { @sum_v2($x + &rest)
} // Terminating Macro
macro @sum_v2($x) { $x
} Parameter packs can also be used by non-recursive macros which wish to call other recursive macros. A more interesting use of variadic macros might be to chain variables together in relative constraints: macro @chain($a, &rest) { // Add the first link in the chain, then move to the rest. var $a: int; @chain_next($a; &rest)
} macro @chain_next($prev, $next, &rest) { // Add the next link, constrain based on the previous link and continue. var $next: int; constraint $next > $prev + 10; @chain_next($next; &rest)
} macro @chain_next($prev, $last) { // Just expand to the final link. var $last: int; constraint $last > $prev + 10; $last
} When called as var r = @chain(m; n; p), the following code would be produced: var m: int;
var n: int;
constraint n > m + 10;
var p: int;
constraint p > n + 10;
var r = p; Array Argument Splicing An extension to macro argument packing the the concept of array splicing . Array splicing allows passing the elements of an array variable, in place, as the arguments to a macro call. This is done by prefixing the array name with a tilde ~. Say we want to find the sum of the elements of some array of integers. If we were to use the variadic macro @sum from earlier, we would have to write something like: var array: int[4];
var sum_of_array = @sum(array[0]; array[1]; array[2]; array[3]); The issue with the above is that it's quite verbose, especially when the array size is large. Instead, array splicing allows us to write this instead: var sum_of_array_v2 = @sum(~array); The compiler will then split array into its individual elements and pass them as separate arguments to @sum, so that the resulting expansion is var sum_of_array_v2 = @sum(array[0]; array[1]; array[2]; array[3]); Array splicing is usually only useful with variadic macros which can handle arrays of different sizes, though a non-variadic macro may be called with array splicing if the array size exactly matches the number of required arguments. An important property of array splicing is that the array element accesses are expanded in place and the argument separators are only placed between them and not at their ends! The following: var two: int[2];
@foo(~two + ~two + ~two); expands to: @foo(two[0]; two[1] + two[0]; two[1] + two[0]; two[1]); This may be a bit surprising at first, but what is really happening here is that each ~two gets replaced verbatim with two[0]; two[1] and the + signs stay exact where they were. So, the three spliced arrays make up a total of 4 separate arguments in this specific case. Similarly, var nums = [1, 2, 3];
constraint @sum(100 + ~nums * 200) < 1000; expands to: constraint @sum(100 + nums[0]; nums[1]; nums[2] * 200) < 1000; The arithmetic add and multiply are applied to the first and last elements of the array in this example.

